import React, { useState } from 'react';

function AddEmployee() {
  const [personalData, setPersonalData] = useState({});
  const [contactData, setContactData] = useState({});
  const [addresses, setAddresses] = useState({});
  const [marketing, setMarketing] = useState({});

  const handlePersonalChange = (e) => {
    setPersonalData({ ...personalData, [e.target.name]: e.target.value });
  };
  const handleContactChange = (e) => {
    setContactData({ ...contactData, [e.target.name]: e.target.value });
  };
  const handleAddressChange = (e) => {
    setAddresses({ ...addresses, [e.target.name]: e.target.value });
  };
  const handleMarketingChange = (e) => {
    setMarketing({ ...marketing, [e.target.name]: e.target.checked });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const data = {
      ...personalData,
      ...contactData,
      ...addresses,
      ...marketing
    };
    // Tu odošli data na backend alebo spracuj podľa potreby
    alert(JSON.stringify(data, null, 2));
  };

  return (
    <div className="container mt-5" style={{ maxWidth: 700 }}>
      <h2>Pridať zamestnanca</h2>
      <form onSubmit={handleSubmit}>
        {/* OSOBNÉ ÚDAJE */}
        <fieldset className="mb-4">
          <legend>Osobné údaje</legend>
          <div className="mb-2">
            <label>Meno:</label>
            <input name="meno" type="text" className="form-control" onChange={handlePersonalChange} />
          </div>
          <div className="mb-2">
            <label>Priezvisko:</label>
            <input name="priezvisko" type="text" className="form-control" onChange={handlePersonalChange} />
          </div>
          <div className="mb-2">
            <label>Dátum narodenia:</label>
            <input name="datumNarodenia" type="date" className="form-control" onChange={handlePersonalChange} />
          </div>
          {/* ďalšie osobné polia */}
        </fieldset>

        {/* KONTAKTNÉ ÚDAJE */}
        <fieldset className="mb-4">
          <legend>Kontaktné údaje</legend>
          <div className="mb-2">
            <label>Email:</label>
            <input name="email" type="email" className="form-control" onChange={handleContactChange} />
          </div>
          <div className="mb-2">
            <label>Telefón:</label>
            <input name="telefon" type="tel" className="form-control" onChange={handleContactChange} />
          </div>
          {/* ďalšie kontaktné polia */}
        </fieldset>

        {/* ADRESY */}
        <fieldset className="mb-4">
          <legend>Adresy</legend>
          <div className="mb-2">
            <label>Trvalá adresa:</label>
            <input name="trvalaAdresa" type="text" className="form-control" onChange={handleAddressChange} />
          </div>
          <div className="mb-2">
            <label>Korešpondenčná adresa:</label>
            <input name="korespondencnaAdresa" type="text" className="form-control" onChange={handleAddressChange} />
          </div>
          {/* ďalšie adresové polia */}
        </fieldset>

        {/* MARKETING */}
        <fieldset className="mb-4">
          <legend>Marketing</legend>
          <div className="mb-2">
            <label>
              <input name="newsletter" type="checkbox" onChange={handleMarketingChange} /> Odoberať newsletter
            </label>
          </div>
          <div className="mb-2">
            <label>
              <input name="suhlas" type="checkbox" onChange={handleMarketingChange} /> Súhlas so spracovaním údajov
            </label>
          </div>
          {/* ďalšie marketingové polia */}
        </fieldset>

        <button type="submit" className="btn btn-primary">Uložiť zamestnanca</button>
      </form>
    </div>
  );
}

export default AddEmployee;
